import React, {Component} from 'react';
import {Navbar} from 'react-bootstrap';

class Header extends Component{
  render(){
    return(
      <Navbar bg="dark" variant="dark">
        <Navbar.Brand>aanshor.space</Navbar.Brand>
      </Navbar>
    );
  }
}

export default Header;
